Thoải m&aacute;i mang đi khắp nơi</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dell Vostro 14 3400 YX51W6 </strong>c&oacute; lớp vỏ ngo&agrave;i được ho&agrave;n thiện với chất lượng cao. Lớp sơn đen phủ to&agrave;n th&acirc;n m&aacute;y c&ugrave;ng logo Dell đặt ch&iacute;nh giữa nắp m&aacute;y tạo n&ecirc;n sự tinh tế v&agrave; hiện đại.</p>\r\n\r\n<p>K&iacute;ch thước của m&aacute;y rất nhỏ gọn (32,9 x 23,9 cm), nặng chỉ <strong>1,59kg</strong> v&agrave; mỏng <strong>2cm</strong> sẵn s&agrave;ng đồng h&agrave;nh c&ugrave;ng bạn trong mọi c&ocirc;ng việc tại văn ph&ograve;ng hoặc tại giảng đường học tập.</p>\r\n\r\n<p><strong><strong>&nbsp;</strong></strong></p>\r\n\r\n<h3><strong>Cấu h&igrave;nh đa nhiệm tốt</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dell Vostro 14 3400 YX51W6</strong> sử dụng CPU <strong>i5-1135G7 </strong>4 nh&acirc;n 8 luồng thế hệ thứ 11 của Intel Tiger Lake được sản xuất tr&ecirc;n tiến tr&igrave;nh 10nm, xung nhịp tối đa 4.2GHz.</p>\r\n\r\n<p>M&aacute;y c&oacute; <strong>RAM 8GB </strong>bus 3200, c&ugrave;ng ổ <strong>SSD 512GB</strong> M.2 NVMe khởi động/tắt Windows v&agrave; c&aacute;c phần mềm si&ecirc;u nhanh, thực hiện đa nhiệm hiệu quả kh&ocirc;ng lo gặp t&igrave;nh trạng giật/lag. Ngo&agrave;i ra nếu c&oacute; th&ecirc;m nhu cầu n&acirc;ng cấp RAM, Dell đ&atilde; d&agrave;nh sẵn th&ecirc;m 1 khe trống tr&ecirc;n chiếc m&aacute;y để người d&ugrave;ng c&oacute; thể n&acirc;ng cấp.</p>\r\n\r\n<p>Chạy c&aacute;c ứng dụng đồ họa v&agrave; giải tr&iacute; tr&ecirc;n chiếc laptop Dell Vostro 14 n&agrave;y nay đ&atilde; hiệu quả hơn với card đồ họa rời NVIDIA <strong>Geforce MX330 2GB</strong> GDDR5. Từ những ứng dụng l&agrave;m ảnh như Photoshop, Lightroom cho đến l&agrave;m video như Premiere hay c&aacute;c game online th&igrave; chiếc laptop n&agrave;y đều c&oacute; thể chạy tốt.</p>\r\n\r\n<p><strong><strong>&nbsp;</strong></strong></p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh chống l&oacute;a</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>M&agrave;n h&igrave;nh của <strong>Dell Vostro 14 3400 YX51W6 </strong>l&agrave; m&agrave;n h&igrave;nh c&oacute; c&ocirc;ng nghệ chống l&oacute;a Anti-Glare, viền mỏng vừa đủ c&oacute; k&iacute;ch thước 14 inch v&agrave; độ ph&acirc;n giải Full HD. Tấm nền được sử dụng l&agrave; WVA cho người d&ugrave;ng một g&oacute;c nh&igrave;n rộng l&ecirc;n tới <strong>178 độ</strong>.</p>\r\n\r\n<p>Với những th&ocirc;ng số tr&ecirc;n, h&igrave;nh ảnh tr&ecirc;n chiếc laptop Dell Vostro n&agrave;y ho&agrave;n to&agrave;n đủ sức để đ&aacute;p ứng nhu cầu sử dụng l&acirc;u d&agrave;i m&agrave; kh&ocirc;ng g&acirc;y mỏi mắt cho người d&ugrave;ng.</p>\r\n\r\n<p><strong><strong>&nbsp;</strong></strong></p>\r\n\r\n<h3><strong>Keyboard cho cảm gi&aacute;c tốt</strong></h3>\r\n\r\n<p>B&agrave;n ph&iacute;m của <strong>Dell Vostro 14 3400 YX51W6</strong> c&oacute; sắp xếp c&aacute;c khoảng c&aacute;ch phim vừa đủ, c&aacute;c ph&iacute;m to v&agrave; k&yacute; tự được in r&otilde; r&agrave;ng. Lực nhấn &amp; phản hồi vừa phải cho một cảm gi&aacute;c lướt &amp; g&otilde; ph&iacute;m &ecirc;m &aacute;i ch&iacute;nh x&aacute;c khi thao t&aacute;c nhanh.</p>\r\n\r\n<p>Touchpad của laptop đủ lớn để hỗ trợ điều khiển thao t&aacute;c với chuột cũng như c&aacute;c cử chỉ tắt một c&aacute;ch ch&iacute;nh x&aacute;c. Bề mặt nh&aacute;m tr&ecirc;n chiếc touchpad n&agrave;y cũng cho cảm gi&aacute;c mượt m&agrave; kh&ocirc;ng bị r&iacute;t tay.</p>\r\n\r\n<p><strong><strong>&nbsp;</strong></strong></p>\r\n\r\n<h3><strong>Kết nối &amp; tiện &iacute;ch</strong></h3>\r\n\r\n<p><strong>Dell Vostro 14 3400 YX51W6</strong> c&oacute; đầy đủ c&aacute;c cổng kết nối đa dạng:</p>\r\n\r\n<ul>\r\n	<li>1 x USB Type-C</li>\r\n	<li>1 x HDMI</li>\r\n	<li>1 x USB 2.0</li>\r\n	<li>2 x USB 3.1</li>\r\n	<li>1 x jack tai nghe 3.5</li>\r\n	<li>1 x cổng mạng RJ45</li>\r\n	<li>1 x đầu đọc thẻ nhớ</li>\r\n</ul>', 3, 2, 8, 'dell vostro 14, dell 14 3400, yx51w6, dell vostro, dell 3400', 'Laptop Dell Vostro 14 3400 YX51W6 (Core™ i5-1135G7 | 8GB | 512GB | MX330 2GB | 14-inch FHD | Win 11 | Office | Đen)', '2022-10-25 20:39:34', '2023-01-08 05:09:23', '2023-01-08 05:09:23');
